class TadTable {

    constructor(e) {
        this.url = e.url;
        this.action_url = e.action_url;
        this.remove_question = (e.remove_question) ? e.remove_question: "Are you sure you want to delete the selected items?";
        this.apply_button = (e.apply_button) ? e.apply_button: "#apply-action";
        this.table = (e.table) ? e.table : '.tad-table';
        this.field_id = (e.field_id) ? e.field_id : 'id';
        this.form_search = (e.form_search) ? e.form_search : "#form-search";
        this.sort_name = (e.sort_name) ? e.sort_name : 'id';
        this.sort_order = (e.sort_order) ? e.sort_order : 'desc';
        this.page_size = (e.page_size) ? e.page_size: 20;
        this.search = (e.search) ? e.search : false;
        this.method = (e.method) ? e.method : 'get';
        this.locale = (e.locale) ? e.locale : 'en-US';

        this.init();
    }

    init() {
        let apply_button = $(this.apply_button);
        apply_button.prop('disabled', true);
        let table = $(this.table);
        let form_search = this.form_search;
        let action_url = this.action_url;
        let remove_question = this.remove_question;
        let data_url = this.url;
        let field_id = this.field_id;
        let method = this.method;
        let locale = this.locale;

        table.bootstrapTable({
            url: data_url,
            idField: field_id,
            method: method,
            locale: locale,
            sidePagination: 'server',
            pagination: true,
            sortName: this.sort_name,
            sortOrder: this.sort_order,
            toggle: 'table',
            search: this.search,
            pageSize: this.page_size,
            queryParams: function (params) {
                let field_search = $(form_search).serializeArray();
                $.each(field_search, function (i, item) {
                    if (params[item.name]) {
                        params[item.name] += ';' + item.value;
                    }
                    else {
                        params[item.name] = item.value;
                    }

                });
                return params;
            }
        });

        function action_button() {
            apply_button.prop('disabled', !table.bootstrapTable('getSelections').length);
        }

        $(this.form_search).on('change', 'select', function (event) {
            if (event.isDefaultPrevented()) {
                return false;
            }

            event.preventDefault();

            table.bootstrapTable('refresh');
            return false;
        });

        $(this.form_search).on('submit', function (event) {
            if (event.isDefaultPrevented()) {
                return false;
            }

            event.preventDefault();

            table.bootstrapTable('refresh');
            return false;
        });

        table.on('check.bs.table uncheck.bs.table ' +
            'check-all.bs.table uncheck-all.bs.table ' +
            'pre-body.bs.table', () => {

            action_button();

        });

        apply_button.on('click', function () {
            let action = $('select[name=bulk_actions]').val();
            let ids = $("input[name=btSelectItem]:checked").map(function(){return $(this).val();}).get();

            if (!ids || !action) {
                return false;
            }

            if (action == 'delete') {
                Swal.fire({
                    title: '',
                    text: remove_question,
                    type: 'warning',
                    showCancelButton: true,
                    confirmButtonColor: '#3085d6',
                    cancelButtonColor: '#d33',
                    confirmButtonText: 'Đồng ý!',
                    cancelButtonText: 'Hủy!',
                }).then((result) => {
                    if (result.value) {
                        $.ajax({
                            type: "POST",
                            url: action_url,
                            dataType: 'json',
                            data: {
                                'ids': ids,
                                'action': action
                            },
                            success: function (result) {
                                if (result.status === true) {
                                    show_message(result);

                                    table.bootstrapTable('refresh');
                                    $('select[name=bulk_actions]').val(null);
                                    return false;
                                }
                                else {
                                    show_message(result);
                                    return false;
                                }
                            }
                        });
                    }
                });
            }
            else {
                $.ajax({
                    type: "POST",
                    url: action_url,
                    dataType: 'json',
                    data: {
                        'ids': ids,
                        'action': action
                    },
                    success: function (result) {
                        if (result.status === true) {
                            show_message(result);

                            table.bootstrapTable('refresh');
                            $('select[name=bulk_actions]').val(null);
                            return false;
                        }
                        else {
                            show_message(result);
                            return false;
                        }
                    }
                });
            }

            return false;
        });

        /*table.on('click', '.remove-item', function () {
            let ids = [$(this).data('id')];
            if (!confirm(remove_question)) {
                return false;
            }

            $.ajax({
                type: "POST",
                url: remove_url,
                dataType: 'json',
                data: {
                    'ids': ids
                },
                success: function (result) {
                    if (result.status === "success") {
                        table.bootstrapTable('refresh');
                        return false;
                    }
                    else {

                        table.bootstrapTable('refresh');
                        return false;
                    }
                }
            });

            return false;
        });*/
    }

    refresh(options = {}) {
        if (options) {
            $(this.table).bootstrapTable('refreshOptions', options);
        }
        else {
            $(this.table).bootstrapTable('refresh', options);
        }
    }
}

